import React from "react";

interface User {
  name: string;
  id: number;
}

class UserAccount {
  name: string;
  username: string | undefined;
  id: number;

  constructor(name: string, id: number) {
    this.name = name;
    this.id = id;
  }
}

export const viewType:User = new UserAccount("Stepheny", 1);

